@import url("https://fonts.googleapis.com/css?family=Roboto+Mono:400,500,700&display=swap");
@import url("https://fonts.googleapis.com/css?family=Lato:300,400");
@import url("https://fonts.googleapis.com/css?family=UnifrakturCook:700&display=swap");
@import url("https://fonts.googleapis.com/css?family=Gochi+Hand&display=swap");
html {
  box-sizing: border-box;
}
*,
*:before,
*:after {
  box-sizing: inherit;
}

body {
  margin: 0;
  font-family: "Roboto Mono", monospace;
  background-color: #eee;
}

$app-width: 833px;

// Colors
$white: #fffdfe;
$paper: #fefefc;
$gold: #f2bc40;

// Light BG colors
$maroon: MAROON;
$bright-red: #f51811;
$red: #8a0f14;
$orange: #dd7c37;
$yellow: #ebc848;
$yellow-green: #afb14c;
$light-green: #82b141;
$lime-green: #7eb938;
$green: #34703c;
$blue: #1e2c69;
$deep-purple: #422246;
$purple: #695f9b;

$blue-green: #9fcda9;
$light-blue: #9ea3c0;
$pink: #facec0;
$source: #f3eeea;

// Dark BG colors
$light-purple: #cbcada;
$dark-blue: #060515;
$black: #030303;

// Text
h1,
h2,
h3,
h4,
h5,
h6 {
  display: block;
  margin: 0px 0px 13px 0px;
  padding: 0;
  line-height: 1;
  font-weight: 400;
  color: $gold;
  transition: 0.4s ease;
}

p {
  max-width: 666px;
  margin: 0px 0px 13px 0px;
  padding: 0;
  font-weight: 400;
  line-height: 1.4;
  letter-spacing: 0.2px;
  font-size: 14px;
  color: $white;
  transition: 0.4s ease;

  a {
    &:after {
      content: "";
      position: absolute;
      bottom: -10px;
      display: block;
      width: 100%;
      height: 1px;
      background-color: $light-blue;
      opacity: 0;
      transition: 0.4s ease;
    }

    &:hover {
      text-decoration: none;

      &:after {
        bottom: 0px;
        opacity: 1;
        background-color: $bright-red;
      }
    }
  }
}

a {
  position: relative;
  display: inline-block;
  text-decoration: none;
  color: $light-blue;
  transition: 0.3s linear;
  &:hover {
    color: $bright-red;
  }
}

ul,
ol {
  max-width: 666px;
  margin: 0px 0px 16px 0px;
  padding-left: 30px;
  color: $yellow;

  li {
  }
}

// App Container
#App {
  display: flex;
  min-height: 100vh;
  flex-direction: column;
  align-items: center;
  background-color: $dark-blue;
  transition: 0.4s ease;

  &.theme-light {
    background-color: $source;

    color: $black;

    p {
      color: $black;
    }

    a {
      color: $purple;

      &:hover {
        color: $bright-red;
      }
    }

    h2 {
      color: $dark-blue;
    }

    h3 {
      color: $dark-blue;
    }

    h4 {
      color: $dark-blue;
    }

    h5 {
      color: $dark-blue;
    }

