      border: 1px solid $dark-blue;

      h3 {
        border-bottom: 1px solid $dark-blue;
      }
    }
  }

  // Header/Footer
  & > header,
  & > footer {
    width: 100%;
    .banner-bg {
      display: block;
      width: 100%;
      height: 48px;
      position: relative;
      background-image: url("./assets/banner-bg.jpg");
      background-repeat: no-repeat;
      background-position: center;
      background-size: cover;
      // transition: 0.4s linear;

      &:hover {
        animation: dimout 0.8s linear;
        animation-delay: 2s;
      }

      @keyframes dimout {
        0% {
          opacity: 1;
        }
        50% {
          opacity: 0.8;
        }
        100% {
          opacity: 1;
        }
      }

      &:hover:before {
        opacity: 0.75;
      }

      &:before {
        content: "";
        display: block;
        width: 100%;
        height: 48px;
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        background-image: url("./assets/banner-bg-hover.jpg");
        background-position: inherit;
        background-repeat: inherit;
        background-size: inherit;
        opacity: 0;
        transition: 0.4s linear;
      }
    }

    nav a {
      display: block;
      font-size: 15px;
      line-height: 1;
      margin-right: 2vw;
      letter-spacing: 1px;
      color: $light-blue;

      &:hover {
        color: $bright-red;
      }

      &:after {
        content: none;
      }
    }
  }

  // Header
  & > header {
    &.expand {
      height: 54px;
      &:before {
        height: 54px;
      }
    }

    #header-nav {
      position: relative;
      max-width: $app-width;
      margin: 16px auto 0px auto;
      padding: 0px 13px;
      nav {
        display: flex;
        justify-content: flex-start;
        align-items: baseline;
        width: 100%;

        a:first-of-type {
          margin-left: 7px;
          font-size: 25px;
          text-transform: none;
        }

        a.active-link {
          color: $gold;
        }

        @media screen and (max-width: 688px) {
          justify-content: center;
          a:not(.name-link) {
            display: none;
          }
        }
      }
    }

    #mobile-header-nav {
      display: none;
      margin-top: 18px;
      padding: 0px 13px;

      @media screen and (max-width: 688px) {
        display: block;
      }

      #hamburger {
        width: 30px;
        height: 23px;
        position: relative;
        margin: 20px auto;
        transform: rotate(0deg);
        cursor: pointer;
        transition: 0.5s ease-in-out;

        &:hover span {
          background-color: $red;
        }

        span {
          display: block;
          position: absolute;
          height: 3px;
          width: 100%;
          background-color: $yellow;
          border-radius: 9px;
          opacity: 1;
          left: 0;
          transform: rotate(0deg);
          transition: 0.25s ease-in-out;
        }

        span:nth-child(1) {
          top: 0px;
        }

        span:nth-child(2) {
          top: 8px;
          height: 2px;
        }
        span:nth-child(3) {
          top: 8px;
          height: 2px;
        }

        span:nth-child(4) {
          top: 16px;
        }

        &.active span:nth-child(1) {
          top: 9px;
          width: 0%;
          left: 50%;
        }

        &.active span:nth-child(2) {
          transform: rotate(45deg);
        }

        &.active span:nth-child(3) {
          transform: rotate(-45deg);
        }

        &.active span:nth-child(4) {
          top: 9px;
          width: 0%;
          left: 50%;
        }
      }

      .drawer {
        border: 2px solid $yellow;
        padding: 13px;

        nav {
          display: flex;
          flex-direction: column;
          align-items: center;
        }

        h3 {
          text-align: center;
        }
      }
    }
    .page-header {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      width: 100%;
      max-width: $app-width;
      margin: 13px auto 7px auto;
      padding: 0px 14px;
      position: relative;
      text-align: center;

      h1 {
        position: relative;
        z-index: 5;
        margin: 0;
        padding: 0px 28px;
        font-family: "Roboto Mono", monospace;
        font-size: 23px;
        font-weight: 400;
        text-transform: uppercase;
        letter-spacing: 0.6px;
        color: $gold;
        background-color: $dark-blue;
        transition: 0.4s ease;
      }

      .strike-through {
        display: block;
        width: 100%;
        height: 2px;
        position: relative;
        z-index: 1;
        top: -13px;
        background-color: $gold;
        transition: 0.4s ease;
      }
    }
  }

  .theme-switch-container {
    position: fixed;
    top: 0;
    right: 0px;
    display: flex;
    align-items: center;
    padding: 6px 0px;
    background-color: gray;

    span {
      margin: 0px 7px;
      font-size: 10px;

      &.active {
        color: $white;
      }
    }

    .selection-container {
      display: block;
      width: 60px;
      padding: 3px;
      height: 25px;
      border-radius: 25px;
      background-color: $white;

      &:hover {
        cursor: pointer;
      }

      .theme-switch {
        display: block;
        width: 50%;
        height: 100%;
        margin-left: 0px;
        border-radius: 50px;
        background-color: lightgray;
        transition: 0.4s ease;

        &.on {
          margin-left: 50%;
        }
      }
    }
  }

  // Footer
  & > footer {
    display: flex;
    flex-direction: column;
    width: 100%;
    text-align: center;

    .page-footer-border {
      padding: 0px 14px;

      > div {
        display: block;
        width: 100%;
        max-width: $app-width;
        height: 2px;
        margin: 13px auto 23px auto;
        background-color: $yellow;
      }
    }

    #footer-nav {
      display: flex;
      align-items: center;
      justify-content: center;
      margin-bottom: 23px;
      padding: 0px 14px;

      a.active-link {
        color: $gold;
      }
    }

    h4 {
      display: flex;
      justify-content: center;
      align-items: center;
      margin-bottom: 23px;
      line-height: 1;
      font-size: 15px;
      font-weight: 400;
      font-family: "Roboto Mono", monospace;
      span {
        margin-right: 3px;
        line-height: 1;
        font-size: 21px;
        height: 22px;
      }
    }
  }
}

