      background-image: url("../src/assets/StefanBobrowski.png");
      background-size: 100%;
      background-position: center;
      transition: all 0.4s linear;
      animation: border-glow 33s linear infinite;

      @keyframes border-glow {
        0% {
          border-color: $source;
        }
        25% {
          border-color: $bright-red;
        }

        33% {
          border-color: $orange;
        }

        50% {
          border-color: $gold;
        }

        66% {
          border-color: $lime-green;
        }

        75% {
          border-color: $light-blue;
        }

        100% {
          border-color: $light-purple;
        }
      }

      .ring {
        display: block;
        width: 100%;
        height: 100%;
        border: 4px solid #fff;
        opacity: 0;
        position: absolute;
        left: 0;
        top: 0;
        // transition: 0.2s ease-out;
        border-radius: 50% 45% 48% 54% / 47% 52% 45% 51%;
        // border-style: inset dashed groove inset;
        animation: aura 3s linear infinite;
      }

      &:before,
      &:after {
        content: "";
        width: 100%;
        height: 100%;
        border: 4px solid #fff;
        opacity: 0;
        position: absolute;
        left: 0;
        top: 0;
        // transition: 0.4s ease-out;
      }

      &:before {
        border-radius: 56% 44% 49% 55% / 45% 53% 39% 52%;
        // border-style: inset dashed groove inset;
        animation: aura 4s linear infinite;
      }

      &:after {
        border-radius: 49% 51% 46% 50% / 49% 59% 41% 51%;
        // border-style: inset inset dashed groove;
        animation: aura 6s linear infinite;
      }

      @keyframes aura {
        0% {
          transform: rotate(0deg) scale(1);
          border-color: $source;
        }
        25% {
          border-color: $bright-red;
        }
        33% {
          border-color: $orange;
        }
        50% {
          border-color: $gold;
          transform: rotate(180deg) scale(1.33);
        }
        66% {
          border-color: $lime-green;
        }

        75% {
          border-color: $light-blue;
        }
        100% {
          transform: rotate(360deg) scale(1);
          border-color: $source;
          border-color: $light-purple;
        }
      }

      &:hover {
        // animation: pulse-a 3s ease-out infinite;

        &:before,
        &:after,
        .ring {
          opacity: 1;
        }
