      }
    }

    .to-do-board-container {
      flex: 1 1 auto;
      padding: 13px;
      border: 1px solid black;

      .to-do-board {
        display: flex;
        flex-wrap: wrap;

        .todo {
          flex: 1 1 168px;
          display: flex;
          justify-content: center;
          align-items: center;
          position: relative;
          // width: 154px;
          min-height: 168px;
          // width: 31%;
          min-width: 144px;
          max-width: 168px;
          // min-height: 140px;
          margin: 1%;
          padding: 20px 6px 0px 6px;
          border: 1px solid black;
          text-align: center;

          &:nth-of-type(4n) {
            background-color: #ffff97;
          }

          &:nth-of-type(4n-1) {
            background-color: #fbae4a;
          }

          &:nth-of-type(4n + 2) {
            background-color: #f275ad;
          }

          &:nth-of-type(4n + 1) {
