  &.cinder {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100%;

    a,
    p,
    h2,
    h3,
    h4 {
      font-family: "Lato", sans-serif;
    }

    #blip-zone {
      display: flex;
      justify-content: center;
      align-items: center;
      width: 550px;
      height: 320px;
      position: relative;
    }

    #coin {
      display: block;
      width: 70px;
      height: 70px;
      position: absolute;
      z-index: 5;
      border-radius: 50%;
      border: 3px solid white;
      background-image: url("../src/projects/Cinder/assets/avatar.jpg");
      background-size: cover;
      background-position: center;
    }

    #blip {
      display: block;
      width: 70px;
      height: 70px;
      position: absolute;
      border-radius: 50%;
      border: 3px solid rgba(256, 125, 145, 0.3);
      background-color: rgba(256, 125, 145, 0.3);
      animation-name: pulse;
      animation-duration: 3s;
      animation-timing-function: linear;
      animation-delay: 0s;
      animation-iteration-count: infinite;
      animation-fill-mode: none;
      animation-play-state: running;
    }

    #blip-2 {
      display: block;
      width: 70px;
      height: 70px;
      position: absolute;
      border-radius: 50%;
      border: 3px solid rgba(256, 125, 145, 0.3);
      background-color: rgba(256, 125, 145, 0.3);
      animation-name: pulse;
      animation-duration: 3s;
      animation-timing-function: linear;
      animation-delay: 1.5s;
      animation-iteration-count: infinite;
      animation-fill-mode: none;
      animation-play-state: running;
    }

    #new-blip {
      display: block;
      width: 70px;
      height: 70px;
      position: absolute;
      border-radius: 50%;
      border: 3px solid rgba(256, 125, 145, 0.3);
      background-color: rgba(256, 125, 145, 0.3);
      animation-name: pulse;
      animation-duration: 3s;
      animation-timing-function: linear;
      animation-delay: 0s;
      animation-iteration-count: 1;
      animation-fill-mode: forwards;
      animation-play-state: running;
    }

    @keyframes pulse {
      0% {
        width: 70px;
        height: 70px;
      }
      100% {
        width: 420px;
        height: 420px;
        background-color: rgba(256, 125, 145, 0);
        border: 3px solid rgba(256, 125, 145, 0);
      }
    }

    .title {
      display: flex;
      align-items: center;
      color: $black;

      img {
        display: block;
        padding-bottom: 8px;
      }

      h2 {
        margin: 0;
        font-size: 38px;
        line-height: 1;
      }
    }

    .bottom-note {
      width: 370px;
      font-size: 15px;
      line-height: 19px;
      text-align: center;
      color: gray;
    }

    .side-note {
      width: 120px;
      height: 140px;
      margin: auto;
      position: absolute;
      top: -30px;
      bottom: 0px;
      right: 13%;
      font-size: 14px;
      font-weight: bold;
      text-align: center;
    }

    .side-note img {
      margin-left: -40px;
      transform: rotate(17deg);
    }
  }

  &.got-vote {
    .fetch-wrapper {
      display: flex;
      flex-wrap: wrap;
      justify-content: flex-start;

      .char {
        width: 60px;
        margin-right: 14px;

        &:hover {
          cursor: pointer;
          transform: scale(1.1);
