        img {
          display: block;
          width: 100%;
          margin: 0 auto 7px auto;
        }

        p {
          margin-bottom: 7px;
          font-size: 10px;
          line-height: 1;
          text-align: center;
        }
      }
    }
  }

  // DATA CENTER
  &.data-center {
    #data-table {
      tr {
        td {
          text-align: left;
          outline: 1px solid $green;
          padding: 4px 8px;
        }
      }

