      }
    }

    .trash {
      color: gray;
    }

    .common-card {
      color: #fff;
    }
    .green-card {
      color: green;
    }
    .rare-card {
      color: blue;
    }

    .epic-card {
      color: purple;
    }

    .legendary-card {
      color: orangered;
    }
  }
  // WorldMap

  &.world-map {
    form {
      border: 1px solid black;
    }

    .the-world-map {
      display: flex;
    }
    .country {
      display: flex;
      flex-direction: column;
      align-items: center;
      width: 100px;
      height: 100px;
      outline: 1px solid black;

      &.red {
        background-color: red;
      }

      &.green {
        background-color: green;
      }

      &.blue {
        background-color: blue;

        p {
          color: white;
        }
      }

      p {
        color: white;
      }
    }
  }
  // City Life

  &.city-life {
    padding: 8px;
    background-color: silver;

    header {
      display: flex;
      justify-content: center;
      margin-bottom: 8px;

      div {
        margin-right: 20px;
        padding: 6px 10px;
        border: 1px solid black;
        border-radius: 4px;
        background-color: lightblue;

        &.menu {
        }
      }
    }

    #game-board {
      display: flex;
      justify-content: center;
      align-items: center;
      width: 380px;
      height: 380px;
      margin: 0 auto;
      background-color: gray;

      .city-column {
        display: flex;
        flex-direction: column;

        .city-block {
          position: relative;
          display: flex;
          justify-content: center;
          align-items: center;
          width: 58px;
          height: 58px;
          margin: 7px;
          border-radius: 3px;
          box-shadow: 0px 2px 0px 3px black;
          font-size: 22px;
          background-color: sandybrown;
          // user-select: none; /* Standard */

          &.dirt {
            background-color: SADDLEBROWN;
          }

          &.grass {
            background-color: DARKGREEN;
          }

          &.nice-grass {
            background-color: GREEN;
          }

          &.pavement {
            background-color: DARKGRAY;
          }

          &.brick {
            background-color: BROWN;
          }

          &:hover {
            cursor: pointer;
          }

          &.connected {
            &:after {
              content: "";
              display: block;
              height: calc(100% + 6px);
              width: 10px;
              position: absolute;
              background-color: inherit;
            }
          }

          &.con-up {
          }

          &.con-down {
          }

          &.con-right {
            &:after {
              top: -1px;
              left: 98%;
              border-top: 1px solid black;
              border-bottom: 5px solid black;
              z-index: 3;
            }
          }

          &.con-left {
            &:after {
              top: -1px;
              right: 98%;
              border-top: 1px solid black;
              border-bottom: 5px solid black;
            }
          }
        }
      }
    }
  }
}

